    # The command demisto.command() holds the command sent from the user.
    import requests

    URL=demisto.params()["URL"]
    APIKey=demisto.params()["APIKey"]

    def sendrequest(url,gparams):
        headers={"Authorization":APIKey}
        response=requests.get(url,headers=headers,params=gparams)
        if response.status_code == 200:
            return response.json()
        else:
            return_error(response.content)

    def test(url,apikey):
        status=demisto.params()["status"]
        url=url+"/api/cases/{}".format(status)
        headers={"Authorization":apikey}
        response=requests.get(url,headers=headers)
        if response.status_code == 200:
            return response.json()
        else:
            return_error("error")


    if demisto.command() == 'test-module':
        resp=test(URL,APIKey)
        demsito.results("ok")


    elif demisto.command() == 'test':
        demisto.results(test(URL,APIKey))

