  type: python
  commands:
  - name: test
    arguments: []
  - name: gurucul-useractivity
    arguments:
    - name: employeeId
  - name: gurucul-resourceactivity
    arguments:
    - name: resourceName
  - name: gurucul-allusers
    arguments: []
    description: To retrieve a list of all users (identities)
  - name: gurucul-allaccounts
    arguments: []
    description: To retrieve all Accounts Information
  - name: gurucul-allactiveaccounts_resource
    arguments:
    - name: resourceName
    description: To retrieve list of all active accounts for a given resource
  - name: gurucul-useractiveaccounts
    arguments:
    - name: employeeId
    description: o retrieve list of all active accounts and details for a given User/Identity
  - name: gurucul-highriskaccounts_resource
    arguments:
    - name: resourceName
    description: To retrieve high risk accounts for a given resource
  - name: gurucul-userhighriskaccounts
    arguments:
    - name: employeeId
    description: To retrieve high risk accounts for a given user
  - name: gurucul-highriskprivilegedaccounts
    arguments: []
    description: To retrieve list of all high-risk privileged accounts
  - name: gurucul-highprivilegedaccounts_resource
    arguments:
    - name: resourceName
    description: To retrieve all High privileged accounts for a given resource
  - name: gurucul-orphanaccounts
    arguments: []
    description: To retrieve list of all orphan/rogue accounts
  - name: gurucul-orphan_rogueaccounts_resource
    arguments:
    - name: resourceName
    description: To retrieve all orphan/rogue accounts for a given resource
  - name: gurucul-totalorphan_rougeaccounts_count
    arguments: []
    description: To retrieve total count of orphan/rogue accounts
  - name: gurucul-highriskorphan_rogueaccounts
    arguments: []
    description: To retrieve high risk orphan/rogue accounts
  - name: gurucul-highriskorphan_rougeaccounts_resource
    arguments:
    - name: resourceName
  - name: gurucul-dormantaccounts_resource
    arguments:
    - name: resourceName
    description: To retrieve list of dormant accounts for a given resource
  - name: gurucul-dormantaccounts_user
    arguments:
    - name: employeeId
    description: To retrieve all dormant accounts for a given user
  - name: gurucul-terminatedusersactiveaccounts
    arguments: []
    description: To retrieve list of active accounts for terminated users
  - name: gurucul-roles
    arguments: []
    description: To retrieve all roles information
  - name: gurucul-allaccountsentitlement_resource
    arguments:
    - name: resourceName
    description: To retrieve all accounts entitlements for a given resource
  - name: gurucul-accountsentitlement
    arguments: []
    description: To retrieve all user account entitlements
  - name: gurucul-accountsentitlement_resource
    arguments:
    - name: entitlementsName
    - name: resourceName
    description: To retrieve all Accounts that have a given entitlement on a resource
  - name: gurucul-highriskentitlements
    arguments: []
    description: To retrieve list of all high risk entitlements
  - name: gurucul-highriskusers
    arguments: []
    description: To retrieve all high risk user information
  - name: gurucul-userdetails
    arguments:
    - name: employeeId
    description: To retrieve detailed information for a given user
  - name: gurucul-behavioralanomalies_user
    arguments:
    - name: employeeId
    description: To retrieve behavioral anomalies triggered for a given user
  - name: gurucul-behavioralanomalies_resource
    arguments:
    - name: resourceName
    description: To retrieve behavioral anomalies triggered for a given resource
  - name: gurucul-triggeredbehaviormodel_users
    arguments:
    - name: anomalyName
    description: To retrieve detailed list of users triggered for a given behavior
      model
  - name: gurucul-triggeredbehaviormodel_users_count
    arguments:
    - name: anomalyName
    description: To retrieve count of users triggered for a given behavior model
  - name: gurucul-highrisktransactions_user
    arguments:
    - name: employeeId
    description: To retrieve all high risk transactions for a given user
  - name: gurucul-highrisktransactions_resource
    arguments:
    - name: resourceName
    description: To retrieve all high risk transactions for a given resource
  - name: gurucul-riskdetails_user_date
    arguments:
    - name: employeeId
    - name: date
    description: To retrieve risk details for a given user for a given date
  - name: guruculjobs_status
    arguments:
    - name: status
      auto: PREDEFINED
      predefined:
      - SCHEDULED
      - SUCCESS
      - FAILED
      - RUNNING
      - UNSCHEDULED
      - PAUSED
    description: To retrieve list of jobs based on job status
  - name: guruculcases_status
    arguments:
    - name: status
      auto: PREDEFINED
      predefined:
      - OPEN
      - CLOSED
      - RISK ACCEPTED
      - REOPENED
      - ALL
    description: To retrieve list of all cases for a given status
  - name: gurucul-allaccountsentitlement_user
    arguments:
    - name: employeeId
    description: To retrieve all account entitlements for a given user
  isfetch: true
  runonce: false
